    "2016-11-25T21:06:05.459677",nt"name": "consolidated-state-performance-report-200910",nt"isopen":
    true,nt"url": null,nt"notes": "The Consolidated State Performance Report,
    2009-10 (CSPR 2009-10), is part of the Consolidated State Performance Report (CSPR)
    program: a required annual reporting tool for each state, the Bureau of Indian Education,
    the District of Columbia, and Puerto Rico; program data is available since 2005-06
    at <http://www2.ed.gov/admins/lead/account/consolidated/index.html>. CSPR 2009-10
    (http://www2.ed.gov/admins/lead/account/consolidated/sy09-10part1/index.html; http://www2.ed.gov/admins/lead/account/consolidated/sy09-10part2/index.html)
    is a cross-sectional report that measures each state's progress towards implementation
    of the No Child Left Behind Act (NCLB) and the reporting instrument for state formula
    grant programs authorized by the Elementary and Secondary Education Act (ESEA) as
    amended by NCLB. The reporting was conducted using state education agencies' (SEAs)
    reports in the EDFacts online submission system. CSPR 2009-10 is a universe survey.
    The study's response rate was 100%.  Key statistics include information on adequate
    yearly progress, state performance assessments, highly qualified teachers, public
    school choice and supplemental education services options.",nt"license_title":
